import React, { useEffect } from 'react';

type Props = {
    titre?: string,
    photo?: string
}

const Projet: React.FC<Props> = ({ titre, photo }) => {
    useEffect(() => {
        setTimeout(function() {
            document.getElementsByClassName('projet')[0].classList.add('ouvert');
        }, 1000);
    }, []);

    return(
        <div className="projet" style={{backgroundImage: `url(${photo})`}}>
            <h4>{titre}</h4>
        </div>
    );
}

export default Projet;
